import React from 'react'
import './Menu.scss'

const Menu = () => {

    const menu = ['About', 'Careers', 'Events', 'Products', 'Suport']


    return (
        <nav className='nav'>
            <ul className='nav__contenedorLista'>
                {
                    menu.map((e, index) => {
                        return(
                            <li  key={index} className='nav__lista'>
                            <a className='nav__menu' href="">{e}</a>
                        </li>
                        )
                    })
                }
            </ul>
        </nav>
    )
}

export default Menu
